import React from "react";

const NotFound = () => {
  return (
    <div className="error">
      <img
        src="https://image.freepik.com/free-vector/glitch-error-404-page_23-2148105404.jpg"
        alt=""
      />
    </div>
  );
};

export default NotFound;
